        /// <summary>
        /// Description : DrAtc00.Bas : ADMIN.OCS_OUTDRUGMST 데이터 불러오기
        /// Author : 이정현
        /// Create Date : 2018.02.05
        /// </summary>
        /// <param name="pDbCon">DB Connect</param>
        /// <param name="strDate"></param>
        /// <param name="dblSlipNo"></param>
        /// <param name="strPano"></param>
        /// <param name="TOM"></param>
        /// <returns></returns>
        /// <seealso cref="READ_OutDrugMst_NEW"/>
        public bool READ_OutDrugMst(PsmhDb pDbCon, string strDate, double dblSlipNo, string strPano, ref Type_OutDrugMst TODM)
        {
            string SQL = "";
            DataTable dt = null;
            string SqlErr = "";
            int intRowAffected = 0;
            bool rtnVal = false;
            
            Clear_Type_OutDrugMst(TODM);

            try
            {
                SQL = "";
                SQL = "SELECT";
                SQL = SQL + ComNum.VBLF + "     a.Pano, b.Sname, a.DeptCode, a.DrCode, a.SlipNo, a.Bi, ";
                SQL = SQL + ComNum.VBLF + "     TO_CHAR(a.BDate, 'YYYY-MM-DD') AS BDate,";
                SQL = SQL + ComNum.VBLF + "     TO_CHAR(a.EntDate, 'YYYY-MM-DD HH24:MI') AS EntDate,";
                SQL = SQL + ComNum.VBLF + "     TO_CHAR(a.SendDate, 'YYYY-MM-DD HH24:MI') AS SendDate,";
                SQL = SQL + ComNum.VBLF + "     TO_CHAR(a.PrtDate, 'YYYY-MM-DD HH24:MI') AS PrtDate,";
                SQL = SQL + ComNum.VBLF + "     TO_CHAR(a.ActDate, 'YYYY-MM-DD') AS ActDate, a.Part, a.SeqNo, A.GBV252,A.GBV352, ";
                SQL = SQL + ComNum.VBLF + "     a.Flag, a.PrtDept, a.Remark, a.Diease1, a.Diease2, a.Diease1_RO, a.Diease2_RO, a.ROWID, ";
                SQL = SQL + ComNum.VBLF + "     a.DrBunho, a.IpdOpd, b.Sex, b.Jumin1, b.Jumin2, b.jumin3, a.PrtBun, a.HapPrint, A.REMARKDRUG ";
                SQL = SQL + ComNum.VBLF + "FROM " + ComNum.DB_MED + "OCS_OUTDRUGMST a, " + ComNum.DB_PMPA + "BAS_PATIENT b ";
              //  SQL = SQL + ComNum.VBLF + "     WHERE a.SlipDate = TO_DATE('" + strDate + "','YYYY-MM-DD') ";
                SQL = SQL + ComNum.VBLF + "     WHERE a.BDate = TO_DATE('" + strDate + "','YYYY-MM-DD') ";
                SQL = SQL + ComNum.VBLF + "         AND a.SlipNo = " + dblSlipNo;

                if (strPano != "")
                {
                    SQL = SQL + ComNum.VBLF + "         AND A.PANO = '" + strPano + "' ";
                }

                SQL = SQL + ComNum.VBLF + "         AND a.Pano = b.Pano(+) ";

                SqlErr = clsDB.GetDataTable(ref dt, SQL, pDbCon);

                if (SqlErr != "")
                {
                    clsDB.setRollbackTran(pDbCon);
                    ComFunc.MsgBox("조회중 문제가 발생했습니다");
                    clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                    Cursor.Current = Cursors.Default;
                    return rtnVal;
                }

                if (dt.Rows.Count == 0)
                {
                    TODM.strSlipDate = strDate;
                    TODM.dblSlipNo = dblSlipNo;

                    clsDB.setRollbackTran(pDbCon);
                    Cursor.Current = Cursors.Default;
                    dt.Dispose();
                    dt = null;
                    return rtnVal;
                }

                TODM.strSlipDate = strDate;
                TODM.dblSlipNo = dblSlipNo;
                TODM.strPano = dt.Rows[0]["Pano"].ToString().Trim();
                TODM.strName = dt.Rows[0]["Sname"].ToString().Trim();
                TODM.strBDate = dt.Rows[0]["BDate"].ToString().Trim();
                TODM.strJumin1 = dt.Rows[0]["Jumin1"].ToString().Trim();
                TODM.strJumin2 = clsAES.DeAES(dt.Rows[0]["Jumin3"].ToString().Trim());
                TODM.intAge = ComFunc.AgeCalcEx(TODM.strJumin1 + TODM.strJumin2, TODM.strBDate);
                TODM.strSex = dt.Rows[0]["Sex"].ToString().Trim();
                TODM.strDeptCode = dt.Rows[0]["DeptCode"].ToString().Trim();
                TODM.strDrCode = dt.Rows[0]["DrCode"].ToString().Trim();
                TODM.strBi = dt.Rows[0]["Bi"].ToString().Trim();
                TODM.strFlag = dt.Rows[0]["Flag"].ToString().Trim();
                TODM.strPrtDept = dt.Rows[0]["PrtDept"].ToString().Trim();
                TODM.strActDate = dt.Rows[0]["ActDate"].ToString().Trim();
                TODM.strPart = dt.Rows[0]["Part"].ToString().Trim();
                TODM.dblSEQNO = VB.Val(dt.Rows[0]["SeqNo"].ToString().Trim());
                TODM.strEntDate = dt.Rows[0]["EntDate"].ToString().Trim();
                TODM.strSendDate = dt.Rows[0]["SendDate"].ToString().Trim();
                TODM.strPrtDate = dt.Rows[0]["PrtDate"].ToString().Trim();
                TODM.strRemark = dt.Rows[0]["Remark"].ToString().Trim();
                TODM.strDiease1 = dt.Rows[0]["Diease1"].ToString().Trim();
                TODM.strDiease2 = dt.Rows[0]["Diease2"].ToString().Trim();

                TODM.strDiease1_RO = dt.Rows[0]["Diease1_RO"].ToString().Trim();  //2012-06-26
                TODM.strDiease2_RO = dt.Rows[0]["Diease2_RO"].ToString().Trim();  //2012-06-26

                TODM.dblDrBunho = VB.Val(dt.Rows[0]["DrBunho"].ToString().Trim());
                TODM.strIpdOpd = dt.Rows[0]["IpdOpd"].ToString().Trim();
                TODM.strROWID = dt.Rows[0]["ROWID"].ToString().Trim();
                TODM.strPrtBun = dt.Rows[0]["PRTBUN"].ToString().Trim();
                TODM.strHapPrint = dt.Rows[0]["HapPrint"].ToString().Trim();
                TODM.strGbV252 = dt.Rows[0]["GBV252"].ToString().Trim();
                TODM.strGbV352 = dt.Rows[0]["GBV352"].ToString().Trim();
                TODM.strRemarkDrug = dt.Rows[0]["REMARKDRUG"].ToString().Trim();

                dt.Dispose();
                dt = null;

                if (TODM.strDiease1.Trim() == "")
                {
                    SQL = "";
                    SQL = "SELECT";
                    SQL = SQL + ComNum.VBLF + "     IllCode";
                    SQL = SQL + ComNum.VBLF + "FROM " + ComNum.DB_MED + "OCS_OILLS ";
                    SQL = SQL + ComNum.VBLF + "     WHERE Ptno = '" + strPano + "' ";
                    SQL = SQL + ComNum.VBLF + "         AND BDate = TO_DATE('" + TODM.strBDate + "','YYYY-MM-DD') ";
                    SQL = SQL + ComNum.VBLF + "         AND DeptCode = '" + TODM.strDeptCode + "' ";
                    SQL = SQL + ComNum.VBLF + "ORDER BY SeqNo ";

                    SqlErr = clsDB.GetDataTable(ref dt, SQL, pDbCon);

                    if (SqlErr != "")
                    {
                        clsDB.setRollbackTran(pDbCon);
                        ComFunc.MsgBox("조회중 문제가 발생했습니다");
                        clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                        Cursor.Current = Cursors.Default;
                        return rtnVal;
                    }
                    if (dt.Rows.Count > 0)
                    {
                        TODM.strDiease1 = dt.Rows[0]["ILLCODE"].ToString().Trim();

                        if (dt.Rows.Count > 1)
                        {
                            TODM.strDiease2 = dt.Rows[1]["ILLCODE"].ToString().Trim();
                        }
                    }

                    dt.Dispose();
                    dt = null;

                    if (TODM.strDiease1.Trim() == "" && TODM.strDiease2.Trim() == "")
                    {
                        SQL = "";
                        SQL = "UPDATE " + ComNum.DB_MED + "OCS_OUTDRUGMST";
                        SQL = SQL + ComNum.VBLF + "     SET";
                        SQL = SQL + ComNum.VBLF + "         Diease1 = '" + TODM.strDiease1.Trim() + "' ";
                        SQL = SQL + ComNum.VBLF + "WHERE SlipDate = TO_DATE('" + strDate + "', 'YYYY-MM-DD') ";
                        SQL = SQL + ComNum.VBLF + "     AND SlipNo = " + dblSlipNo;
                        SQL = SQL + ComNum.VBLF + "     AND PANO = '" + strPano + "' ";
                    }
                    else if (TODM.strDiease1.Trim() == "" && TODM.strDiease2.Trim() != "")
                    {
                        SQL = "";
                        SQL = "UPDATE " + ComNum.DB_MED + "OCS_OUTDRUGMST";
                        SQL = SQL + ComNum.VBLF + "     SET ";
                        SQL = SQL + ComNum.VBLF + "         Diease1 = '" + TODM.strDiease1.Trim() + "', ";
                        SQL = SQL + ComNum.VBLF + "         Diease2 = '" + TODM.strDiease2.Trim() + "' ";
                        SQL = SQL + ComNum.VBLF + "WHERE SlipDate = TO_DATE('" + strDate + "','YYYY-MM-DD') ";
                        SQL = SQL + ComNum.VBLF + "     AND SlipNo = " + dblSlipNo;
                        SQL = SQL + ComNum.VBLF + "     AND PANO = '" + strPano + "' ";
                    }

                    SqlErr = clsDB.ExecuteNonQuery(SQL, ref intRowAffected, pDbCon);

                    if (SqlErr != "")
                    {
                        clsDB.setRollbackTran(pDbCon);
                        ComFunc.MsgBox(SqlErr);
                        clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                        Cursor.Current = Cursors.Default;
                        return rtnVal;
                    }
                }

                if (TODM.dblDrBunho > 0)
                {
                    rtnVal = true;
                    return rtnVal;
                }

                //전공의
                if (VB.Right(TODM.strDrCode, 2) == "99")
                {
                    rtnVal = true;
                    return rtnVal;
                }

                //의사 면허번호
                SQL = "";
                SQL = "SELECT";
                SQL = SQL + ComNum.VBLF + "     DrBunho";
