        public bool UPDATE_OutDrugMst(PsmhDb pDbCon, string ArgPrt, Type_OutDrugMst TODM)
        {
            string SQL = "";
            string SqlErr = "";
            int intRowCnt = 0;
            bool rtnVal = false;

            try
            {
                SQL = "";
                SQL += ComNum.VBLF + " UPDATE " + ComNum.DB_MED + "OCS_OUTDRUGMST";
                SQL += ComNum.VBLF + "    SET Flag      = '" + TODM.strFlag + "', ";
                SQL += ComNum.VBLF + "        Diease1   = '" + TODM.strDiease1.Trim() + "', ";
                SQL += ComNum.VBLF + "        Diease2   = '" + TODM.strDiease2.Trim() + "', ";
                SQL += ComNum.VBLF + "        Remark    = '" + TODM.strRemark + "', ";
                SQL += ComNum.VBLF + "        PrtDept   = '" + TODM.strPrtDept.Trim() + "', ";
                SQL += ComNum.VBLF + "        DrBunho   = " + TODM.dblDrBunho + ", ";
                SQL += ComNum.VBLF + "        SendDate  = TO_DATE('" + Convert.ToDateTime(TODM.strSendDate.Trim()).ToString("yyyy-MM-dd HH:mm") + "','YYYY-MM-DD HH24:MI'), ";
                SQL += ComNum.VBLF + "        PrtDate   = TO_DATE('" + Convert.ToDateTime(TODM.strPrtDate.Trim()).ToString("yyyy-MM-dd HH:mm") + "','YYYY-MM-DD HH24:MI'), ";

                if (ArgPrt == "NO")
                    SQL += ComNum.VBLF + "    CHKPRT    = 'Y', ";

                SQL += ComNum.VBLF + "        GBAUTO    = 'Y' ";
                SQL += ComNum.VBLF + "  WHERE ROWID     = '" + TODM.strROWID + "' ";

                SqlErr = clsDB.ExecuteNonQuery(SQL, ref intRowCnt, pDbCon);

                if (SqlErr != "")
                {
                    clsDB.setRollbackTran(pDbCon);
                    ComFunc.MsgBox(SqlErr);
                    clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                    Cursor.Current = Cursors.Default;
                    return rtnVal;
                }

                rtnVal = true;
                return rtnVal;
            }
            catch (Exception ex)
            {
                clsDB.setRollbackTran(pDbCon);
                ComFunc.MsgBox(ex.Message);
                clsDB.SaveSqlErrLog(ex.Message, SQL, pDbCon); //에러로그 저장
                Cursor.Current = Cursors.Default;
                return rtnVal;
            }
        }

