        /// <summary>
        /// Description : DrAtc00.Bas : 동일과에 1일 2매이상 처방전 여부
        /// Author : 이정현
        /// Create Date : 2018.02.05
        /// </summary>
        /// <param name="pDbCon">DB Connect</param>
        /// <param name="strBDate"></param>
        /// <param name="strPano"></param>
        /// <param name="strDept"></param>
        /// <returns></returns>
        public bool DRUG_Double_Check(PsmhDb pDbCon, string strBDate, string strPano, string strDept)
        {
            string SQL = "";
            DataTable dt = null;
            string SqlErr = "";
            bool rtnVal = false;

            Cursor.Current = Cursors.WaitCursor;

            try
            {
                SQL = "";
                SQL = "SELECT";
                SQL = SQL + ComNum.VBLF + "     SlipNo, COUNT(*) AS CNT ";
                SQL = SQL + ComNum.VBLF + "FROM " + ComNum.DB_MED + "OCS_OUTDRUGMST ";
                SQL = SQL + ComNum.VBLF + "     WHERE Pano = '" + strPano +"' ";
                SQL = SQL + ComNum.VBLF + "         AND SlipDate = TO_DATE('" + strBDate +"','YYYY-MM-DD') ";
                SQL = SQL + ComNum.VBLF + "         AND DeptCode = '" + strDept +"' ";
                SQL = SQL + ComNum.VBLF + "         AND Flag <> 'D' ";
                SQL = SQL + ComNum.VBLF + "GROUP BY SlipNo ";

                SqlErr = clsDB.GetDataTable(ref dt, SQL, pDbCon);

                if (SqlErr != "")
                {
                    ComFunc.MsgBox("조회중 문제가 발생했습니다");
                    clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                    Cursor.Current = Cursors.Default;
                    return rtnVal;
                }
                if (dt.Rows.Count > 0)
                {
                    if (dt.Rows.Count > 1) { rtnVal = true; }
                    if (VB.Val(dt.Rows[0]["CNT"].ToString().Trim()) > 1) { rtnVal = true; }
                }

                dt.Dispose();
                dt = null;

                Cursor.Current = Cursors.Default;
                return rtnVal;
            }
            catch (Exception ex)
            {
                if (dt != null)
                {
                    dt.Dispose();
                    dt = null;
                }

                ComFunc.MsgBox(ex.Message);
                clsDB.SaveSqlErrLog(ex.Message, SQL, pDbCon); //에러로그 저장
                Cursor.Current = Cursors.Default;
                return rtnVal;
            }
        }

