                        ArgSlipNo = Convert.ToDouble(clsPmpaPb.GstrPrintData);
                        clsPmpaPb.GstrPrintData = "";
                    }
                }
            }
            else if (DRUG_Double_Check(pDbCon, ArgBdate, ArgPtno, ArgDept) && ArgGubun == "2") //자동합산
            {
                OutDrug_AutoHap(pDbCon, ArgPtno, ArgBdate, ArgDept, ArgSlipNo);

                if (clsPmpaPb.GstrMobileSunap != "OK") //무인수납장비사용여부
                {
                    if (ArgPrtOK == "OK")
                        MessageBox.Show("자동합산 처리됨." + '\r' + "이전 처방전은 반드시 회수하시기 바랍니다.", "자동합산", MessageBoxButtons.OK, MessageBoxIcon.Information);
                }

                if (clsPmpaPb.GstrPrintData != "")
                {
                    ArgSlipNo = Convert.ToDouble(clsPmpaPb.GstrPrintData);
                    clsPmpaPb.GstrPrintData = "";
                }
            }

            READ_OutDrugMst(pDbCon, ArgBdate, ArgSlipNo, ArgPtno, ref TODM);

            if (TODM.strROWID == null) { TODM.strROWID = ""; }

            if (TODM.strROWID.Trim() == "")
            {
                MessageBox.Show("원외처방 자료가 없습니다.", "알림", MessageBoxButtons.OK, MessageBoxIcon.Stop);
                //return;
            }

            if (TODM.strFlag == "0" || TODM.strFlag == "S" || TODM.strFlag == " " || TODM.strFlag == "2")
                OutDRUG_DataCheck(pDbCon, TODM.strPano, ArgBdate, TODM.dblSlipNo, ref TODM);

            Drug_Slip_Display(pDbCon, ref TODM); //처방내역을 조회

            if (TODM.strSendDate.Trim() == "")
            {
                ComFunc.ReadSysDate(pDbCon);
                TODM.strSendDate = clsPublic.GstrSysDate + " " + clsPublic.GstrSysTime;
            }

            if (TODM.strFlag == "2") { TODM.strFlag = "0"; }
            if (TODM.strFlag == "0" || TODM.strFlag == "S") { TODM.strFlag = "Y"; }
            if (TODM.strFlag != "P") { TODM.strFlag = "P"; }

            TODM.strPrtDate = clsPublic.GstrSysDate + " " + clsPublic.GstrSysTime;
            TODM.strPrtDept = "";

            UPDATE_OutDrugMst(pDbCon, ArgPrtOK, TODM);

            TODM.strSingu = ArgSingu;

            ssSpread = new FarPoint.Win.Spread.FpSpread();
            ssSpread_Sheet1 = new FarPoint.Win.Spread.SheetView();

            if (clsPmpaPb.GstrOutDrugPrintGubun == "1") //2021-11-16 약국보관용
            {
                SetDrugPrint(ref ssSpread, ref ssSpread_Sheet1);
                ClearDrugPrint(ssSpread, ssSpread_Sheet1);
                OutDRUG_Slip_Print(pDbCon, ssSpread, ssSpread_Sheet1, TODM, TODM.strPano, TODM.strBDate, TODM.dblSlipNo, ArgPrtOK, "LASER", false, "1", clsPmpaPrint.DRUG_PRINTER_NAME);
            }
            else if (clsPmpaPb.GstrOutDrugPrintGubun == "2") //2021-11-16 환자보관용
            {
                SetDrugPrint(ref ssSpread, ref ssSpread_Sheet1);
                ClearDrugPrint(ssSpread, ssSpread_Sheet1);
                OutDRUG_Slip_Print(pDbCon, ssSpread, ssSpread_Sheet1, TODM, TODM.strPano, TODM.strBDate, TODM.dblSlipNo, ArgPrtOK, "LASER", false, "2", clsPmpaPrint.DRUG_PRINTER_NAME);
            }
            else
            {
                SetDrugPrint(ref ssSpread, ref ssSpread_Sheet1);
                ClearDrugPrint(ssSpread, ssSpread_Sheet1);
                // OutDRUG_Slip_Print(pDbCon, ssSpread, ssSpread_Sheet1, TODM, TODM.strPano, TODM.strBDate, TODM.dblSlipNo, ArgPrtOK, "LASER", false, "1", clsPmpaPrint.DRUG_PRINTER_NAME);
                OutDRUG_Slip_Print(pDbCon, ssSpread, ssSpread_Sheet1, TODM, TODM.strPano, TODM.strBDate, TODM.dblSlipNo, ArgPrtOK, "LASER", false, "1", clsPmpaPrint.DRUG_PRINTER_NAME);

                SetDrugPrint(ref ssSpread, ref ssSpread_Sheet1);
                ClearDrugPrint(ssSpread, ssSpread_Sheet1);
                OutDRUG_Slip_Print(pDbCon, ssSpread, ssSpread_Sheet1, TODM, TODM.strPano, TODM.strBDate, TODM.dblSlipNo, ArgPrtOK, "LASER", false, "2", clsPmpaPrint.DRUG_PRINTER_NAME);
            }
            return;
        }
        public bool Check_OCS_OUTDRUGMST_Order(PsmhDb pDbCon, string ArgPtno, string ArgDept, string ArgBDATE)
        {
