            SQL += ComNum.VBLF + "    AND a.Pano        = '" + TODM.strPano + "' ";
            SQL += ComNum.VBLF + "    AND (a.Flag  <> 'D' OR a.Flag  IS NULL) ";
            SQL += ComNum.VBLF + "    AND a.SuCode      = b.SuNext(+) ";
