                    nDiv = VB.Val(DtP.Rows[i]["Div"].ToString().Trim());
                    nNal = VB.Val(DtP.Rows[i]["Nal"].ToString().Trim());
                    strGbSelf = DtP.Rows[i]["GbSelf"].ToString().Trim();
