                        strRemark2 += "    " + DtP.Rows[i]["SuCode"].ToString().Trim() + " → " + DtP.Rows[i]["DUR"].ToString().Trim() + '\r';
                        strDurRemark += DtP.Rows[i]["DUR"].ToString().Trim() + " → " + DtP.Rows[i]["SuNamek"].ToString().Trim();
