                    SQL = "";
                    SQL += ComNum.VBLF + " UPDATE " + ComNum.DB_MED + "OCS_OUTDRUG ";
                    SQL += ComNum.VBLF + "    SET SuCode    = '" + strSuCode + "',";
                    SQL += ComNum.VBLF + "        Div       =  " + nDiv + ", ";
                    SQL += ComNum.VBLF + "        DivQty    =  " + nDivQty + ", ";
                    SQL += ComNum.VBLF + "        Nal       =  " + nNal + ",";
                    SQL += ComNum.VBLF + "        DosCode   = '" + strDosCode + "', ";
                    SQL += ComNum.VBLF + "        Remark    = '" + strRemark1 + "',";
                    SQL += ComNum.VBLF + "        GbSelf    = '" + strGbSelf + "' ";
                    SQL += ComNum.VBLF + " WHERE ROWID      = '" + DtP.Rows[i]["ROWID"].ToString().Trim() + "' ";
