            SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
            SQL += ComNum.VBLF + "    AND ACTDATE   = TO_DATE('" + TODM.strActDate + "','YYYY-MM-DD') ";
            SQL += ComNum.VBLF + "    AND PANO      = '" + TODM.strPano + "' ";
            SQL += ComNum.VBLF + "    AND BDATE     = TO_DATE('" + TODM.strBDate + "' ,'YYYY-MM-DD') ";
            SQL += ComNum.VBLF + "    AND DRCODE    = '" + TODM.strDrCode + "' ";
