                strDurRemark += "    " + "처방사유 : " + DtP.Rows[0]["REMARK"].ToString() + '\r';
            }

            DtP.Dispose();
            DtP = null;

            rtnVal = true;
            return rtnVal;
        }


        /// <summary>
        /// 원외처방전 자동합산
        /// </summary>
        /// <param name="ArgPtno"></param>
        /// <param name="ArgBdate"></param>
        /// <param name="ArgDept"></param>
        /// <param name="ArgSlipNo"></param>
        /// <seealso cref="Drug_out_atc.bas : 원외처방전_자동합산"/>
        public bool OutDrug_AutoHap(PsmhDb pDbCon, string ArgPtno, string ArgBdate, string ArgDept, double ArgSlipNo)
        {
            DataTable DtP = new DataTable();
            string SQL = string.Empty;
            string SqlErr = string.Empty;
            int intRowCnt = 0;
            bool rtnVal = false;

            string strRowID = "";
            string strAllSlipNo = "";
            int nTuno = 0;
            int nSlipNo = 0;
            int nSelTuno = 0;
            int nSelSlipNo = 0;

            clsPmpaPb.GstrPrintData = "";

            //ETC_TUYAK의 해당 정보를 READ
            SQL = "";
            SQL += ComNum.VBLF + " SELECT TuNo, TuIlsu SlipNo, Flag, ";
            SQL += ComNum.VBLF + "        ROWID,";
            SQL += ComNum.VBLF + "        TO_CHAR(SunapTime,'HH24:MI') SuNapTime,";
            SQL += ComNum.VBLF + "        TO_CHAR(JepsuTime,'HH24:MI') JepsuTime,";
            SQL += ComNum.VBLF + "        TO_CHAR(JojeTime,'HH24:MI')  JojeTime,";
            SQL += ComNum.VBLF + "        TO_CHAR(TuyakTime,'HH24:MI') TuyakTime ";
            SQL += ComNum.VBLF + "   FROM " + ComNum.DB_PMPA + "ETC_TUYAK ";
            SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
            SQL += ComNum.VBLF + "    AND TuDate    = TO_DATE('" + ArgBdate + "','YYYY-MM-DD') ";
            SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
            SQL += ComNum.VBLF + "    AND DeptCode  = '" + ArgDept + "' ";
            SQL += ComNum.VBLF + "    AND SlipGbn   = '3' "; //원외처방전만
            SQL += ComNum.VBLF + "    AND Flag      <> 'D' ";//삭제된것은 제외
            SQL += ComNum.VBLF + "  ORDER BY TuNo ";
            SqlErr = clsDB.GetDataTable(ref DtP, SQL, pDbCon);

            if (SqlErr != "")
            {
                ComFunc.MsgBox("조회중 문제가 발생했습니다");
                clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                Cursor.Current = Cursors.Default;
                DtP.Dispose();
                DtP = null;
                return rtnVal;
            }

            if (DtP.Rows.Count > 0)
            {
                for (int i = 0; i < DtP.Rows.Count; i++)
                {
                    strAllSlipNo = strAllSlipNo + DtP.Rows[i]["SLIPNO"].ToString() + ",";
                    //합산할 마지막 투약,slipno읽음
                    nSelTuno = Convert.ToInt32(DtP.Rows[i]["TuNo"].ToString());
                    nSelSlipNo = Convert.ToInt32(DtP.Rows[i]["SlipNo"].ToString());
                }
            }

            if (strAllSlipNo == "")
            {
                MessageBox.Show("합산할 원외처방전을 1건도 선택안함.", "알림",  MessageBoxButtons.OK,  MessageBoxIcon.Stop);
                clsPmpaPb.GstrPrintData = ArgSlipNo.ToString();
                DtP.Dispose();
                DtP = null;
                return rtnVal;
            }

            clsPmpaPb.GstrPrintData = nSelSlipNo.ToString();

            try
            {
                for (int i = 0; i < DtP.Rows.Count; i++)
                {
                    nTuno = Convert.ToInt32(DtP.Rows[i]["TuNo"].ToString());
                    nSlipNo = Convert.ToInt32(DtP.Rows[i]["SlipNo"].ToString());
                    strRowID = DtP.Rows[i]["ROWID"].ToString().Trim();

                    SQL = "";
                    if (nTuno == nSelTuno) //합산할 투약번호
                    {
                        SQL += ComNum.VBLF + " UPDATE " + ComNum.DB_PMPA + "ETC_TUYAK ";
                        SQL += ComNum.VBLF + "    SET Flag      = '0',";
                        SQL += ComNum.VBLF + "        JojeTime  = '', ";
                        SQL += ComNum.VBLF + "        TuyakTime = '' ";
                        SQL += ComNum.VBLF + "  WHERE ROWID     = '" + strRowID + "' ";
                    }
                    else //취소(삭제)할 투약번호
                    {
                        SQL += ComNum.VBLF + " UPDATE " + ComNum.DB_PMPA + "ETC_TUYAK ";
                        SQL += ComNum.VBLF + "    SET Flag      = 'D' ";
                        SQL += ComNum.VBLF + "  WHERE ROWID     = '" + strRowID + "' ";
                    }
                    SqlErr = clsDB.ExecuteNonQuery(SQL, ref intRowCnt, pDbCon);

                    if (SqlErr != "")
                    {
                        clsDB.setRollbackTran(pDbCon);
                        ComFunc.MsgBox("ETC_TUYAK UPDATE Error !!" + SqlErr);
                        clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon);
                        Cursor.Current = Cursors.Default;
                        return rtnVal;
                    }

                    if (nSlipNo == nSelSlipNo) //합산된 처방전은 미인쇄 상태로 전환
                    {
                        SQL = "";
                        SQL += ComNum.VBLF + " UPDATE " + ComNum.DB_MED + "OCS_OUTDRUGMST ";
                        SQL += ComNum.VBLF + "    SET FLAG      = '0', ";
                        SQL += ComNum.VBLF + "        PrtDate   = '',";
                        SQL += ComNum.VBLF + "        PrtDept   = ' ', ";
                        SQL += ComNum.VBLF + "        SendDate  = '', ";
                        SQL += ComNum.VBLF + "        HAPPRINT  = '1' ";
                        SQL += ComNum.VBLF + "  WHERE SlipDate  = TO_DATE('" + ArgBdate + "','YYYY-MM-DD') ";
                        SQL += ComNum.VBLF + "    AND SlipNo    = " + nSelSlipNo + " ";
                        SqlErr = clsDB.ExecuteNonQuery(SQL, ref intRowCnt, pDbCon);

                        if (SqlErr != "")
                        {
                            clsDB.setRollbackTran(clsDB.DbCon);
                            ComFunc.MsgBox("원외처방전 마스타 대기자로 전환시 오류가 발생함" + SqlErr);
                            clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon);
                            Cursor.Current = Cursors.Default;
                            return rtnVal;
                        }
                    }
                    else 
                    {
                        //합산으로 취소된 원외처방마스타는 삭제 SET
                        SQL = "";
                        SQL += ComNum.VBLF + " UPDATE " + ComNum.DB_MED + "OCS_OUTDRUGMST ";
                        SQL += ComNum.VBLF + "    SET FLAG      = 'D', ";
                        SQL += ComNum.VBLF + "        HAPPRINT  = '' ";
                        SQL += ComNum.VBLF + "  WHERE SlipDate  = TO_DATE('" + ArgBdate + "','YYYY-MM-DD') ";
                        SQL += ComNum.VBLF + "    AND SlipNo    = " + nSlipNo + " ";
                        SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
                        SqlErr = clsDB.ExecuteNonQuery(SQL, ref intRowCnt, pDbCon);

                        if (SqlErr != "")
                        {
                            clsDB.setRollbackTran(clsDB.DbCon);
                            ComFunc.MsgBox("원외처방전 마스타 삭제SET 오류가 발생함" + SqlErr);
                            clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon);
                            Cursor.Current = Cursors.Default;
                            return rtnVal;
                        }

                        //해당 원외처방전을 합산
                        SQL = "";
                        SQL += ComNum.VBLF + " UPDATE " + ComNum.DB_MED + "OCS_OUTDRUG ";
                        SQL += ComNum.VBLF + "    SET SlipNo    = " + nSelSlipNo + " ";
                        SQL += ComNum.VBLF + "  WHERE SlipDate  = TO_DATE('" + ArgBdate + "','YYYY-MM-DD') ";
                        SQL += ComNum.VBLF + "    AND SlipNo    = " + nSlipNo + " ";
                        SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
                        SqlErr = clsDB.ExecuteNonQuery(SQL, ref intRowCnt, pDbCon);

                        if (SqlErr != "")
                        {
                            clsDB.setRollbackTran(pDbCon);
                            ComFunc.MsgBox("원외처방전 번호를 합산시 오류가 발생함" + SqlErr);
                            clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon);
                            Cursor.Current = Cursors.Default;
                            return rtnVal;
                        }
                    }
                }
            }
            catch (Exception ex)
            {
                ComFunc.MsgBox(ex.Message);
                clsDB.SaveSqlErrLog(ex.Message, SQL, pDbCon);
                Cursor.Current = Cursors.Default;
                return rtnVal;
            }

            DtP.Dispose();
            DtP = null;
            rtnVal = true;
            return rtnVal;
        }

        /// <summary>
        /// 
        /// </summary>
        /// <param name="pDbCon"></param>
        /// <param name="ArgGb"></param>
        /// <param name="ArgPtno"></param>
        /// <param name="ArgBdate"></param>
        /// <param name="ArgBi"></param>
        /// <param name="ArgDept"></param>
        /// <param name="ArgSname"></param>
        /// <param name="ArgSeqNo"></param>
        /// <param name="ArgBdate2"></param>
        /// <returns></returns>
        /// <seealso cref="drug_out_atc.bas : 수납_약관련메시지"/>
        public bool Drug_Sunap_Message(PsmhDb pDbCon, string ArgGb, string ArgPtno, string ArgBdate, string ArgBi, string ArgDept, string ArgSname, int ArgSeqNo, string ArgBdate2)
        {
            DataTable DtP = new DataTable();
            string SQL = string.Empty;
            string SqlErr = string.Empty;
            int intRowCnt = 0;
            string rtnR = "";
            string strMsg1 = "";
            string strMsg2 = "";
            string strRemark = "";
            bool rtnVal = false;

            rtnR = Read_Drug_ATC_OutDrug(pDbCon, "1", ArgPtno, ArgBdate, ArgBi, ArgDept, clsType.User.IdNumber, ArgSeqNo);
            Read_Drug_ATC_OutDrug_Msg(pDbCon, "1", ArgPtno, ArgBdate, ArgBi, ArgDept, ArgSeqNo, ArgBdate2);

            if (clsPmpaPb.GstrInDrugMsg1 == "수납1")
            {
                rtnVal = true;
                return rtnVal;
            }

            if (clsPmpaPb.GstrInDrugFlag == "Y")
            {
                strMsg1 = "원내";

                switch (ArgGb)
                {
                    case "1":
                        strMsg2 = "[수납]";
                        if (clsPmpaPb.GstrInDrugMsg1 == "수납2")
                            strMsg2 += clsPmpaPb.GstrInDrugMsg2;

                        break;

                    case "2":
                        strMsg2 = "[부분수정]";
                        if (clsPmpaPb.GstrInDrugMsg1 == "수납2")
                            strMsg2 += clsPmpaPb.GstrInDrugMsg2;

                        break;

                    case "3":
                        strMsg2 = "[환불]";

                        break;
                }

                strRemark = strMsg1 + " " + strMsg2;

                //오류내역을 DB에 등록
                SQL = "";
                SQL += ComNum.VBLF + " INSERT INTO " + ComNum.DB_PMPA + "ETC_SUNAP_HISTORY ";
                SQL += ComNum.VBLF + "        (JobTime, BDate, BDate2, ";
                SQL += ComNum.VBLF + "         Pano, SName, DeptCode, ";
                SQL += ComNum.VBLF + "         JobSabun, Gbchk, REMARK) ";
                SQL += ComNum.VBLF + " VALUES (SYSDATE, ";
                SQL += ComNum.VBLF + "         TO_DATE('" + ArgBdate + "','YYYY-MM-DD'), ";
                SQL += ComNum.VBLF + "         TO_DATE('" + ArgBdate2 + "','YYYY-MM-DD'), ";
                SQL += ComNum.VBLF + "         '" + ArgPtno + "', ";
                SQL += ComNum.VBLF + "         '" + ArgSname + "', ";
                SQL += ComNum.VBLF + "         '" + ArgDept + "', ";
                SQL += ComNum.VBLF + "          " + clsType.User.IdNumber + ", ";
                SQL += ComNum.VBLF + "         'N', ";
                SQL += ComNum.VBLF + "         '" + strRemark + "' )  ";
                SqlErr = clsDB.ExecuteNonQuery(SQL, ref intRowCnt, pDbCon);

                if (SqlErr != "")
                {
                    clsDB.setRollbackTran(pDbCon);
                    ComFunc.MsgBox("원외처방전 번호를 합산시 오류가 발생함" + SqlErr);
                    clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon);
                    Cursor.Current = Cursors.Default;
                    return rtnVal;
                }
            }

            rtnVal = true;
            return rtnVal;
        }

        /// <summary>
        /// 
        /// </summary>
        /// <param name="pDbCon"></param>
        /// <param name="ArgGb"></param>
        /// <param name="ArgPtno"></param>
        /// <param name="ArgBdate"></param>
        /// <param name="ArgBi"></param>
        /// <param name="ArgDept"></param>
        /// <param name="ArgSeqNo"></param>
        /// <param name="ArgBdate2"></param>
        /// <seealso cref="drug_out_atc.bas : Read_DRUG_ATC_OUTDRUG3"/>
        private void Read_Drug_ATC_OutDrug_Msg(PsmhDb pDbCon, string ArgGb, string ArgPtno, string ArgBdate, string ArgBi, string ArgDept, int ArgSeqNo, string ArgBdate2)
        {
            DataTable DtP = new DataTable();
            string SQL = string.Empty;
            string SqlErr = string.Empty;
            int nDrugCnt1 = 0; //이전 약전체건수
            int nDrugCnt2 = 0; //이전 약 qty 0인 건수
            int nDrugCnt3 = 0; //이전 약 qty 0아닌 건수
            int nDrugCnt4 = 0; //현재 약 건수

            clsPmpaPb.GstrInDrugMsg1 = "";
            clsPmpaPb.GstrInDrugMsg2 = "";

            SQL = "";
            SQL += ComNum.VBLF + " SELECT ROWID ";
            SQL += ComNum.VBLF + "   FROM " + ComNum.DB_MED + "OCS_DRUGATC ";
            SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
            SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
            SQL += ComNum.VBLF + "    AND BDATE2    = TO_DATE('" + ArgBdate2 + "','YYYY-MM-DD')  ";
            SQL += ComNum.VBLF + "    AND DEPTCODE  = '" + ArgDept + "' ";
            SQL += ComNum.VBLF + "    AND SEQNO2    <> " + ArgSeqNo + " ";
            SqlErr = clsDB.GetDataTable(ref DtP, SQL, pDbCon);

            if (SqlErr != "")
            {
                ComFunc.MsgBox("조회중 문제가 발생했습니다");
                clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                Cursor.Current = Cursors.Default;
                DtP.Dispose();
                DtP = null;
                return;
            }

            if (DtP.Rows.Count == 0)
                clsPmpaPb.GstrInDrugMsg1 = "수납1";
            else
                clsPmpaPb.GstrInDrugMsg1 = "수납2";

            DtP.Dispose();
            DtP = null;

            if (clsPmpaPb.GstrInDrugMsg1 == "수납2")
            {
                //현작업 이전의 발생건 읽음
                SQL = "";
                SQL += ComNum.VBLF + " SELECT SuCode, SUM(Qty*Nal) nQty  ";
                SQL += ComNum.VBLF + "   FROM " + ComNum.DB_MED + "OCS_DRUGATC ";
                SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
                SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
                SQL += ComNum.VBLF + "    AND BDATE     = TO_DATE('" + ArgBdate + "','YYYY-MM-DD')  ";
                SQL += ComNum.VBLF + "    AND DEPTCODE  = '" + ArgDept + "' ";
                SQL += ComNum.VBLF + "    AND SEQNO2    <> " + ArgSeqNo + " ";
                SQL += ComNum.VBLF + "   GROUP BY SuCode ";
                SqlErr = clsDB.GetDataTable(ref DtP, SQL, pDbCon);

                if (SqlErr != "")
                {
                    ComFunc.MsgBox("조회중 문제가 발생했습니다");
                    clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                    Cursor.Current = Cursors.Default;
                    DtP.Dispose();
                    DtP = null;
                    return;
                }

                nDrugCnt1 = DtP.Rows.Count;

                for (int i = 0; i < DtP.Rows.Count; i++)
                {
                    if (Convert.ToInt32(VB.Val(DtP.Rows[i]["NQTY"].ToString())) == 0)
                        nDrugCnt2 += 1;
                    else
                        nDrugCnt3 += 1;
                }

                DtP.Dispose();
                DtP = null;

                //현재작업건 읽음
                SQL = "";
                SQL += ComNum.VBLF + " SELECT SuCode, SUM(Qty*Nal) nQty  ";
                SQL += ComNum.VBLF + "   FROM " + ComNum.DB_MED + "OCS_DRUGATC ";
                SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
                SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
                SQL += ComNum.VBLF + "    AND BDATE     = TO_DATE('" + ArgBdate + "','YYYY-MM-DD')  ";
                SQL += ComNum.VBLF + "    AND DEPTCODE  = '" + ArgDept + "' ";
                SQL += ComNum.VBLF + "    AND SEQNO2    =  " + ArgSeqNo + " ";
                SQL += ComNum.VBLF + "   GROUP BY SuCode ";
                SQL += ComNum.VBLF + "   HAVING  SUM(Qty*Nal) >0 ";
                SqlErr = clsDB.GetDataTable(ref DtP, SQL, pDbCon);

                if (SqlErr != "")
                {
                    ComFunc.MsgBox("조회중 문제가 발생했습니다");
                    clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                    Cursor.Current = Cursors.Default;
                    DtP.Dispose();
                    DtP = null;
                    return;
                }

                nDrugCnt4 = DtP.Rows.Count;

                DtP.Dispose();
                DtP = null;

                if (nDrugCnt1 == nDrugCnt2 && nDrugCnt4 > 0)
                    clsPmpaPb.GstrInDrugMsg2 = "전체환불";
                else if (nDrugCnt1 != nDrugCnt2 && nDrugCnt4 > 0)
                    clsPmpaPb.GstrInDrugMsg2 = "부분수정";
            }
        }

        /// <summary>
        /// 
        /// </summary>
        /// <param name="pDbCon"></param>
        /// <param name="ArgGb"></param>
        /// <param name="ArgPtno"></param>
        /// <param name="ArgBdate"></param>
        /// <param name="ArgBi"></param>
        /// <param name="ArgDept"></param>
        /// <param name="ArgPart"></param>
        /// <param name="ArgSeqNo"></param>
        /// <returns></returns>
        /// <seealso cref="drug_out_atc.bas : Read_DRUG_ATC_OUTDRUG"/>
        private string Read_Drug_ATC_OutDrug(PsmhDb pDbCon, string ArgGb, string ArgPtno, string ArgBdate, string ArgBi, string ArgDept, string ArgPart, int ArgSeqNo)
        {
            DataTable DtP = new DataTable();
            string SQL = string.Empty;
            string SqlErr = string.Empty;
            string rtnVal = "0";

            clsPmpaPb.GstrInDrugFlag = "";
            clsPmpaPb.GstrOutDrugFlag = "";

            SQL = "";
            if (ArgDept == "ER")
            {
                SQL += ComNum.VBLF + " SELECT COUNT(*) CNT ";
                SQL += ComNum.VBLF + "   FROM " + ComNum.DB_PMPA + "OPD_SLIP ";
                SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
                SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
                SQL += ComNum.VBLF + "    AND ActDate   = TO_DATE('" + ArgBdate + "','YYYY-MM-DD') ";
                SQL += ComNum.VBLF + "    AND GbIpd     = 'T' "; //퇴원약만 전송(기타는 입원오더센드에서 전달함)
                SQL += ComNum.VBLF + "    AND ((Bun IN ('11','12') AND GbBunup <> '0') ";      //내복,외용약 원내조제
                SQL += ComNum.VBLF + "         OR (Bun = '20' AND  DOSCODE = '999905' )) ";    //주사약제 약국인것
                SQL += ComNum.VBLF + "    AND NOT (DeptCode = 'OG' AND Qty = 1 AND Nal = 1 ";  //산부인과질정등 진료과 투여분 '~1
                SQL += ComNum.VBLF + "             AND SuNext IN (SELECT Sucode FROM " + ComNum.DB_PMPA + "BAS_MSELF ";
                SQL += ComNum.VBLF + "                             WHERE GubunA = 'A')) ";

                if (ArgGb == "2")
                    SQL += ComNum.VBLF + "AND Nal       < 0 ";
                else
                    SQL += ComNum.VBLF + "AND SeqNo     = " + ArgSeqNo + " ";
            }
            else
            {
                SQL += ComNum.VBLF + " SELECT COUNT(*) CNT ";
                SQL += ComNum.VBLF + "   FROM " + ComNum.DB_PMPA + "OPD_SLIP ";
                SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
                SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
                SQL += ComNum.VBLF + "    AND ActDate   = TO_DATE('" + ArgBdate + "','YYYY-MM-DD') ";
                SQL += ComNum.VBLF + "    AND (((Bun IN ('12') AND GbBunup <> '0') OR (BUN='11' AND GbBunup <> '0' AND DOSCODE NOT IN ('499916'))) OR (Bun='20' AND GbBunup <> '0'";
                SQL += ComNum.VBLF + "    AND (DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE ";
                SQL += ComNum.VBLF + "                          WHERE DOSFULLCODE LIKE '진료과%')         ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE '심초음파%')          ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE 'HD%')          ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE '주사실%')          ";

                //2021-01-04 안정수 항암 추가
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE '%(항암)%')                   ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE '%항암주사실%')               ";


                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE '내시경%')          ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE 'PC실%')          ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE '관리과%')          ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE 'ER%')          ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE 'NS Block%')          ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE 'ANGIO%')          ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                       WHERE DOSFULLCODE LIKE '마취%')              ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE '처치%')            ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE DOSFULLCODE LIKE '수술실%')            ";
                SQL += ComNum.VBLF + "    AND DOSCODE NOT IN (SELECT DOSCODE FROM " + ComNum.DB_MED + "OCS_ODOSAGE  ";
                SQL += ComNum.VBLF + "                         WHERE (DOSFULLCODE LIKE '방사%'OR DOSFULLCODE LIKE '영상%'))) ";
                SQL += ComNum.VBLF + "    )) ";
                SQL += ComNum.VBLF + "    AND NOT (DeptCode = 'OG' AND Qty = 1 AND Nal = 1 ";
                SQL += ComNum.VBLF + "             AND SuNext IN (SELECT Sucode FROM " + ComNum.DB_PMPA + "BAS_MSELF ";
                SQL += ComNum.VBLF + "                             WHERE GubunA = 'A'))  ";
                SQL += ComNum.VBLF + "    AND SUNEXT NOT IN ( SELECT JEPCODE FROM " + ComNum.DB_ERP + "DRUG_SETCODE ";
                SQL += ComNum.VBLF + "                             WHERE GUBUN = '01' AND ( DELDATE IS NULL OR DELDATE = '')) ";

                if (ArgGb == "2")
                    SQL += ComNum.VBLF + "AND Nal       < 0 ";
                else
                    SQL += ComNum.VBLF + "AND SeqNo     = " + ArgSeqNo + " ";
            }
            SqlErr = clsDB.GetDataTableEx(ref DtP, SQL, pDbCon);

            if (SqlErr != "")
            {
                ComFunc.MsgBox("조회중 문제가 발생했습니다");
                clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                Cursor.Current = Cursors.Default;
                DtP.Dispose();
                DtP = null;
                return rtnVal;
            }

            if (DtP.Rows.Count == 0 || Convert.ToInt32(VB.Val(DtP.Rows[0]["CNT"].ToString())) == 0)
                clsPmpaPb.GstrInDrugFlag = "";
            else
                clsPmpaPb.GstrInDrugFlag = "Y";

            DtP.Dispose();
            DtP = null;

            SQL = "";
            SQL += ComNum.VBLF + " SELECT SuNext, SUM(Qty*NAL) Qty ";
            SQL += ComNum.VBLF + "   FROM " + ComNum.DB_PMPA + "OPD_SLIP ";
            SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
            SQL += ComNum.VBLF + "    AND Pano      = '" + ArgPtno + "' ";
            SQL += ComNum.VBLF + "    AND DeptCode  = '" + ArgDept + "' ";
            SQL += ComNum.VBLF + "    AND ActDate   = TO_DATE('" + ArgBdate + "','YYYY-MM-DD') ";
            SQL += ComNum.VBLF + "    AND Bun IN ('11','12','20') ";
            SQL += ComNum.VBLF + "    AND GbBunup   = '0'  ";

            if (ArgGb == "2")
                SQL += ComNum.VBLF + "AND Nal       < 0 ";
            else
            {
                SQL += ComNum.VBLF + "AND Part      = '" + ArgPart + "' ";
                SQL += ComNum.VBLF + "AND SeqNo     =  " + ArgSeqNo + " ";
            }

            SQL += ComNum.VBLF + " GROUP BY SuNext ";
            SqlErr = clsDB.GetDataTableEx(ref DtP, SQL, pDbCon);

            if (SqlErr != "")
            {
                ComFunc.MsgBox("조회중 문제가 발생했습니다");
                clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                Cursor.Current = Cursors.Default;
                DtP.Dispose();
                DtP = null;
                return rtnVal;
            }

            if (DtP.Rows.Count > 0)
            {
                if (Convert.ToInt32(VB.Val(DtP.Rows[0]["Qty"].ToString())) == 0)
                    clsPmpaPb.GstrOutDrugFlag = "";
                else
                    clsPmpaPb.GstrOutDrugFlag = "Y";
            }
            else
                clsPmpaPb.GstrOutDrugFlag = "";

            DtP.Dispose();
            DtP = null;

            if (clsPmpaPb.GstrInDrugFlag == "Y" && clsPmpaPb.GstrOutDrugFlag == "Y")
                rtnVal = "3";
            else if (clsPmpaPb.GstrInDrugFlag == "Y")
                rtnVal = "1";
            else if (clsPmpaPb.GstrOutDrugFlag == "Y")
                rtnVal = "2";
            else
                rtnVal = "0";

            return rtnVal;
        }

        /// <summary>
