        public bool Read_Drug_ATC_OutDrug4(PsmhDb pDbCon, string ArgPtno, string ArgBi, string ArgDept, string ArgBdate, int ArgSeqNo)
        {
            DataTable DtFunc = null;
            string SQL = "";
            string SqlErr = "";
            bool rtnVal = false;

            SQL = "";
            SQL += ComNum.VBLF + " SELECT ROWID ";
            SQL += ComNum.VBLF + "   FROM " + ComNum.DB_MED + "OCS_DRUGATC ";
            SQL += ComNum.VBLF + "  WHERE 1         = 1 ";
            SQL += ComNum.VBLF + "    AND PANO      = '" + ArgPtno + "' ";
            SQL += ComNum.VBLF + "    AND BDATE     = TO_DATE('" + ArgBdate + "','YYYY-MM-DD')  ";
            SQL += ComNum.VBLF + "    AND DEPTCODE  = '" + ArgDept + "' "; ;
            SQL += ComNum.VBLF + "    AND SEQNO2    = " + ArgSeqNo + " ";
            SqlErr = clsDB.GetDataTable(ref DtFunc, SQL, pDbCon);

            if (SqlErr != "")
            {
                ComFunc.MsgBox("조회중 문제가 발생했습니다");
                clsDB.SaveSqlErrLog(SqlErr, SQL, pDbCon); //에러로그 저장
                Cursor.Current = Cursors.Default;
                DtFunc.Dispose();
                DtFunc = null;
                return rtnVal;
            }

            if (DtFunc.Rows.Count > 0)
                rtnVal = true;

            DtFunc.Dispose();
            DtFunc = null;

            return rtnVal;
        }

    }
}
